		[TestMethod]
		public void TestORUParse()
		{
			HL7_ORU _result = null;
			List<string> lMsg = InitializeORU;

			// we need to get the HL7 field separator and encoding characters
			_processHL7 = ProcessHL7Message.Instance;
			//HL7_ORU _result = (HL7_ORU)_processHL7.ParseHL7(slMsg: lMsg);
			object obj = _processHL7.ParseHL7(slMsg: lMsg);
			if (obj is HL7_ORU)
				_result = (HL7_ORU)obj;
			else
				Assert.Fail("HL7 Message is not an ORU message type");

			if (IsHeaderValid(_result.HL7Header))
			{
				Assert.Fail("MHS Header validation failed");
			}

			// validate Patients
			if (IsPatientValid(_result.HL7Patient))
			{
				Assert.Fail("Patient segment failed validation");
			}

			if (_result.HL7Patient.NTESegments.Count > 0)
			{
				Assert.Fail("NTE segment failed validation");
			}
			if (_result.HL7Results == null)
			{
				Assert.Fail("Orders object is NULL");
			}
			else
			{
				if (IsResultValid(_result.HL7Results))
				{
					Assert.Fail("Result segments failed");
				}
				if (IsResult9Valid(_result.HL7Results))
				{
					Assert.Fail("Result segments failed");
				}
			}
		}

		private Boolean IsHeaderValid(HL7Header _header)
		{
			Boolean bErr = false;

			var data = _header.MSHSegment.Version;
			Assert.AreNotSame("2.3", data);
			data = _header.MSHSegment.SendingFacility;
			Assert.AreNotSame("PTOX", data);

			if (_header.MSHSegment.Errors.Count > 0)
			{
				string sTmp = string.Empty;
				foreach (var err in _header.MSHSegment.Errors)
				{
					sTmp += err.ToString();
				}
				Assert.Fail(string.Format("MSH segment failed validation: {0}", sTmp));
				bErr = true;
			}
			return bErr;
		}

		private Boolean IsPatientValid(HL7Patient _patient)
		{
			Boolean bErr = false;
			//@"PID|1||P20180294736||TIPPEN^JIM||19590628|M",
			Assert.IsNull(_patient.PIDSegment.ExternalId);
			Assert.AreEqual("P20180294736", _patient.PIDSegment.PatientId, true);
			Assert.AreEqual("JIM", _patient.PIDSegment.FName, true);
			Assert.AreEqual("TIPPEN", _patient.PIDSegment.LName, true);
			Assert.AreEqual("19590628", _patient.PIDSegment.DOB);
			Assert.AreEqual("M", _patient.PIDSegment.Gender, true);

			if (_patient.PIDSegment.Errors.Count > 0)
			{
				Assert.Fail(string.Format("PID segment failed validation: {0}", _patient.PIDSegment.Errors.ToString()));
				bErr = true;
			}
			return bErr;
		}

		private Boolean IsResultValid(List<HL7Results> _result)
		{
			Boolean bErr = false;
			foreach (var result in _result)
			{
				//@"ORC|RE|CE00089999|190700361||CM||||20180920125100|||1111122224^DOE^JANE MD",
				Assert.AreEqual("RE", result.ORCSegment.OrderControl, true);
				Assert.AreEqual("CE00089999", result.ORCSegment.PlacerOrderNumber, true);
				Assert.AreEqual("1111122224", result.ORCSegment.NPI, true);
				Assert.AreEqual("DOE", result.ORCSegment.LastName, true);
				Assert.AreEqual("JANE MD", result.ORCSegment.FirstName, true);

				List<HL7Details> details = result.HL7Details;

				if (details.Count != 9)
				{
					Assert.Fail(string.Format("Details not correct should be 9 is {0}", details.Count));
				}
				int nCnt = 0;
				foreach (var detail in details)
				{
					// OBR,OBX,NTE sequence
					Assert.IsNotNull(detail.OBRSegment);

					if (detail.OBRSegment.Errors.Count > 0)
					{
						Assert.Fail(string.Format("OBR segment failed validation: {0}", detail.OBRSegment.Errors.ToString()));
						bErr = true;
					}
					if (++nCnt == 1)
					{
						//@"OBR|1|CE00089999|190700361|NCU1513013^7-Hydroxymitragynine^^1757^7-Hydroxymitragynine|S||20180920125100|||||||20181003135800|URINE|1111122224^DOE^JANE MD|||||PTox-Main^Precision Diagnostics^4215 Sorrento Valley Blvd^^San Diego^CA^92121^Amadeo Pesce, PhD, DABCC|20181003140122|||F",
						Assert.AreEqual(nCnt, detail.OBRSegment.SeqId);
						Assert.AreEqual("CE00089999", detail.OBRSegment.PlacerOrderNumber, true);
						Assert.AreEqual("190700361", detail.OBRSegment.FillerOrderNumber, true);
						Assert.AreEqual("NCU1513013", detail.OBRSegment.TestCode, true);
						Assert.AreEqual("7-Hydroxymitragynine", detail.OBRSegment.TestCodeDescription, true);
						Assert.AreEqual("", detail.OBRSegment.CodingSystem);
						Assert.AreEqual("1757", detail.OBRSegment.LimTestCode, true);
						Assert.AreEqual("7-Hydroxymitragynine", detail.OBRSegment.LimTestCodeDescription, true);
						Assert.AreEqual("URINE", detail.OBRSegment.SpecimenSource, true);

						Assert.AreEqual("1111122224", detail.OBRSegment.NPI, true);
						Assert.AreEqual("DOE", detail.OBRSegment.LastName, true);
						Assert.AreEqual("JANE MD", detail.OBRSegment.FirstName, true);

						if (detail.Observations.Count > 0)
						{
							Assert.IsNotNull(detail.OBRSegment);
							foreach (var observation in detail.Observations)
							{
								Assert.IsNotNull(observation);
								if (observation.OBXSegment.Errors.Count > 0)
								{
									Assert.Fail(string.Format("OBX segment failed validation: {0}", observation.OBXSegment.Errors.ToString()));
									bErr = true;
								}
								//@"OBX|1|TX|LCMS_NCU1513013^7-Hydroxymitragynine^LN^1757^7-Hydroxymitragynine||Negative|ng/ml|5|N|||F|||20180920125100|05D2054760",
								Assert.AreEqual(1, observation.OBXSegment.SeqId);
								Assert.AreEqual("TX", observation.OBXSegment.ValueType, true);
								// Observation Identifier
								Assert.AreEqual("LCMS_NCU1513013", observation.OBXSegment.TestCode, true);
								Assert.AreEqual("7-Hydroxymitragynine", observation.OBXSegment.TestCodeDescription, true);
								Assert.AreEqual("LN", observation.OBXSegment.CodingSystem, true);
								Assert.AreEqual("1757", observation.OBXSegment.LimTestCode, true);
								Assert.AreEqual("7-Hydroxymitragynine", observation.OBXSegment.LimTestCodeDescription, true);
								Assert.AreEqual("Negative", observation.OBXSegment.ObservationValue, true);
								Assert.AreEqual("ng/ml", observation.OBXSegment.Units, true);
								Assert.AreEqual("5", observation.OBXSegment.ReferenceRange, true);
								Assert.AreEqual("N", observation.OBXSegment.AbnormalFlags, true);
								Assert.AreEqual("F", observation.OBXSegment.ResultStatus, true);
								Assert.AreEqual("20180920125100", actual: observation.OBXSegment.ObservationDateTime);
								Assert.AreEqual("05D2054760", observation.OBXSegment.Producers_ID);


								foreach (var nte in observation.NTESegments)
								{
									//@"NTE|1|TX|Negative^Expected",
									if (nte.Errors.Count > 0)
									{
										Assert.Fail(string.Format("NTE segment failed validation: {0}", nte.Errors.ToString()));
										bErr = true;
									}
									Assert.AreEqual(1, nte.SeqId);
									Assert.AreEqual("TX", nte.Source, true);
									Assert.AreEqual("Negative^Expected", nte.Comment, true);
								}
							}
						}
					}
					else
					{
						Assert.IsNotNull(detail.OBRSegment.SeqId);
						Assert.IsNotNull(detail.OBRSegment.PlacerOrderNumber);
						Assert.IsNotNull(detail.OBRSegment.FillerOrderNumber);
						Assert.IsNotNull(detail.OBRSegment.TestCode);
						Assert.IsNotNull(detail.OBRSegment.TestCodeDescription);
						if (!"POC".Equals(detail.OBRSegment.TestCodeDescription))
						{
							Assert.IsNotNull(detail.OBRSegment.CodingSystem);
							Assert.IsNotNull(detail.OBRSegment.LimTestCode);
							Assert.IsNotNull(detail.OBRSegment.LimTestCodeDescription);
							Assert.IsNotNull(detail.OBRSegment.SpecimenSource);
							Assert.IsNotNull(detail.OBRSegment.NPI);
							Assert.IsNotNull(detail.OBRSegment.LastName);
							Assert.IsNotNull(detail.OBRSegment.FirstName);
						}

						if (detail.Observations.Count > 0)
						{
							int nIdx = 0;
							for ( nIdx = 0; nIdx < detail.Observations.Count-1; nIdx++)	// we will skip the last entry becasue its the PDF segment
							{
								var observation = detail.Observations[nIdx];
								if (observation.OBXSegment.Errors.Count > 0)
								{
									Assert.Fail(string.Format("OBX segment failed validation: {0}", observation.OBXSegment.Errors.ToString()));
									bErr = true;
								}
								// we can only test what is common with all OBX segments
								Assert.AreEqual("LN", observation.OBXSegment.CodingSystem, true);
								Assert.AreEqual("20180920125100", actual: observation.OBXSegment.ObservationDateTime);
								Assert.AreEqual("05D2054760", observation.OBXSegment.Producers_ID);

								foreach (var nte in observation.NTESegments)
								{
									//@"NTE|1|TX|Negative^Expected",
									if (nte.Errors.Count > 0)
									{
										Assert.Fail(string.Format("NTE segment failed validation: {0}", nte.Errors.ToString()));
										bErr = true;
									}
									Assert.AreEqual("TX", nte.Source, true);
								}
							}

							if (nIdx == detail.Observations.Count)
							{
								// this should be the PDF OBX
								// we can only test what is common with all OBX segments
								var observation = detail.Observations[14];
								Assert.AreEqual("ED", observation.OBXSegment.CodingSystem, true);
								Assert.AreEqual("20180920125100", actual: observation.OBXSegment.ObservationDateTime);
								Assert.AreEqual("05D2054760", observation.OBXSegment.Producers_ID);

							}
						}
					}

					// NTE repeating segments
					if (detail.NTESegments.Count > 0)
					{
						int nIdx = 0;
						foreach (var nte in detail.NTESegments)
						{
							if (IsNTEValid(nte, nIdx++))
							{
								Assert.Fail("NTE segment validation failed");
								bErr = true;
							}
						}
					}
				}
			}
			return bErr;
		}

		private Boolean IsDG1Valid(DG1 dg1, int nIdx)
		{
			Boolean bErr = false;

			switch (nIdx)
			{
				case 0:
					Assert.AreEqual(1, dg1.SeqId);
					Assert.AreEqual("I10", dg1.CodingMethod, true);
					Assert.AreEqual("Z79.891", dg1.Code, true);
					Assert.AreEqual("Long term (current) use of opiate analgesic", dg1.Description, true);
					break;
				case 1:
					Assert.AreEqual(2, dg1.SeqId);
					Assert.AreEqual("I10", dg1.CodingMethod, true);
					Assert.AreEqual("F11.20", dg1.Code, true);
					Assert.AreEqual("Opioid dependence, uncomplicated", dg1.Description, true);
					break;
				case 2:
					Assert.AreEqual(3, dg1.SeqId);
					Assert.AreEqual("I10", dg1.CodingMethod, true);
					Assert.AreEqual("Z79.899", dg1.Code, true);
					Assert.AreEqual("Other long term (current) drug therapy", dg1.Description, true);
					break;
				default:
					Assert.Fail("DG1 validation failed (default reached)");
					break;
			}
			if (dg1.Errors.Count > 0)
			{
				Assert.Fail(string.Format("DG1 segment failed validation: {0}", dg1.Errors.ToString()));
				bErr = true;
			}
			return bErr;
		}

		private Boolean IsNTEValid(NTE nte, int nIdx)
		{
			Boolean bErr = false;

			switch (nIdx)
			{
				case 0:
					Assert.AreEqual(1, nte.SeqId);
					Assert.AreEqual("changed the group id", nte.Comment, true);
					break;
				case 1:
					Assert.AreEqual(2, nte.SeqId);
					Assert.AreEqual("Medications Oxycontin", nte.Comment, true);
					break;
				default:
					Assert.Fail("NTE validation failed (default reached)");
					break;
			}

			if (nte.Errors.Count > 0)
			{
				Assert.Fail(string.Format("DG1 segment failed validation: {0}", nte.Errors.ToString()));
				bErr = true;
			}
			return bErr;
		}

		private Boolean IsResult9Valid(List<HL7Results> _result)
		{
			Boolean bErr = false;

			List<HL7Details> details = _result[0].HL7Details;
			HL7Details detail = details[8];


			//@"OBR|9|CE00089999|190700361|1912^POC|S||20180920125100|||||||20181003135800|URINE|1111122224^DOE^JANE MD||||POC^PDX Custom Panel - POC|PTox-Main^Precision Diagnostics^4215 Sorrento Valley Blvd^^San Diego^CA^92121^Amadeo Pesce, PhD, DABCC|20181003135934|||F",
			//@"OBX|1|TX|ABC123^AMP^LN^1912^POC||Negative||||||F|||20180920125100|05D2054760",
			//@"NTE|1|TX|Negative",
			Assert.AreEqual(9, detail.OBRSegment.SeqId);
			Assert.AreEqual("CE00089999", detail.OBRSegment.PlacerOrderNumber, true);
			Assert.AreEqual("1111122224", detail.OBRSegment.NPI, true);
			Assert.AreEqual("DOE", detail.OBRSegment.LastName, true);
			Assert.AreEqual("JANE MD", detail.OBRSegment.FirstName, true);
			Assert.AreEqual("1912", detail.OBRSegment.TestCode, true);
			Assert.AreEqual("POC", detail.OBRSegment.TestCodeDescription, true);

			List<HL7Observation> observations = detail.Observations;
			Assert.IsTrue(observations.Count == 16);

			var obx1 = observations[8];
			Assert.AreEqual(8, obx1.OBXSegment.SeqId);
			Assert.AreEqual("ABC123", obx1.OBXSegment.TestCode);
			Assert.AreEqual("MTD", obx1.OBXSegment.TestCodeDescription);
			Assert.AreEqual("1912", obx1.OBXSegment.LimTestCode);
			Assert.AreEqual("POC", obx1.OBXSegment.LimTestCodeDescription);
			Assert.IsTrue(obx1.NTESegments.Count == 1);
			Assert.AreEqual("TX", obx1.NTESegments[0].Source, true);

			// @"OBX|15|ED|PDF^PDF BASE64|1|^PDFReport^PDF^Base64
			var obx15 = observations[15];
			Assert.AreEqual(15, obx15.OBXSegment.SeqId);
			Assert.AreEqual("ED", obx15.OBXSegment.ValueType);
			Assert.AreEqual("PDF", obx15.OBXSegment.TestCode);
			Assert.AreEqual("PDF BASE64", obx15.OBXSegment.TestCodeDescription);
			Assert.IsTrue(obx15.NTESegments.Count == 0);

			return bErr;
		}

